import React, { useState } from 'react';
import Modal from 'react-modal';
import { FaTimes } from 'react-icons/fa';
import styles from './AddModal.module.css';

Modal.setAppElement('#root');

function AddModal({ isOpen, onRequestClose, onSave }) {
    const [title, setTitle] = useState('');
    const [date, setDate] = useState('');
    const [label, setLabel] = useState('');
    const [priority, setPriority] = useState('일반');
    const [description, setDescription] = useState('');
    const [repeat, setRepeat] = useState('반복 없음');

    // 할 일 저장 함수
    const handleSave = () => {
        if (title.trim() === '') {
            alert('제목을 입력해주세요.');
            return;
        }
        const newTodo = {
            title,
            date,
            label,
            priority,
            description,
            repeat
        };
        onSave(newTodo); // 부모 컴포넌트로 할 일 데이터 전달
        resetForm();
        onRequestClose();
    };

    // 폼 초기화 함수
    const resetForm = () => {
        setTitle('');
        setDate('');
        setLabel('');
        setPriority('일반');
        setDescription('');
        setRepeat('반복 없음');
    };

    return (
        <Modal
            isOpen={isOpen}
            onRequestClose={onRequestClose}
            className={styles.eventModal}
            overlayClassName={styles.eventModalOverlay}
        >
            <div className={styles.modalHeader}>
                <h2>할 일 추가</h2>
                <FaTimes className={styles.closeIcon} onClick={onRequestClose} />
            </div>
            <form>
                {/* 제목 */}
                <label>제목</label>
                <input
                    type="text"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    placeholder="할 일 제목을 입력하세요"
                />

                {/* 날짜 */}
                <label>날짜</label>
                <input
                    type="date"
                    value={date}
                    onChange={(e) => setDate(e.target.value)}
                />

                {/* 라벨 선택 */}
                <label>라벨</label>
                <input
                    type="text"
                    value={label}
                    onChange={(e) => setLabel(e.target.value)}
                    placeholder="라벨 추가..."
                />

                {/* 우선순위 */}
                <label>우선순위</label>
                <select value={priority} onChange={(e) => setPriority(e.target.value)}>
                    <option value="중요">중요</option>
                    <option value="일반">일반</option>
                    <option value="우선순위 없음">우선순위 없음</option>
                </select>

                {/* 설명 */}
                <label>설명</label>
                <textarea
                    value={description}
                    onChange={(e) => setDescription(e.target.value)}
                    placeholder="할 일에 대한 설명을 입력하세요"
                />

                {/* 반복 설정 */}
                <label>반복</label>
                <select value={repeat} onChange={(e) => setRepeat(e.target.value)}>
                    <option value="반복 없음">반복 없음</option>
                    <option value="매일">매일</option>
                    <option value="매주">매주</option>
                    <option value="매월">매월</option>
                </select>

                {/* 저장 버튼 */}
                <button type="button" onClick={handleSave} className={styles.saveButton}>
                    저장
                </button>
            </form>
        </Modal>
    );
}

export default AddModal;
